import React from 'react';
import './App.css';
import NewPaint from './newPaint';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello world</h1> 
        <NewPaint />
      </header>
    </div>
  );
}


export default App;
